import axios from "axios"

export const friendAdd = (friendData) =>  async dispatch => {
    try {
        const headers = {AuthenticationToken:localStorage.getItem('token')}
        const res = await axios.post('/user/addfriend',friendData,{headers:headers})
        // console.log(res)
    } catch (error) {
        console.log(error);
    }
}
